declarations.default:
css`
  :host {
    display: flex;
    flex-direction: column;
    align-items: center;
    justify-content: flex-start;
    font-family: 'Google Sans';
    font-size: 12px;
    color: #000;
    background-color: #fff;
  }

  main {
    flex-grow: 1;
  }

  app-header {
    width: 100%;
    height: 100%;
  }

  .app-footer {
    font-size: 12px;
    align-items: center;
  }
`

css`
    .card {
      border: 1px solid lightgray;
      border-radius: 5px;
      background-color: white;
      margin: 10px;
      border-radius: 10px;
      font-size: 16px;
    }

    .cardWrapper {
      margin: 10px;
      min-width: 280px;
      min-height: 250px;
      display: flex;
      flex-direction: column;
      justify-content: space-between;
    }

    .cardName {
      font-size: 20px;
    }

    .card:nth-child(2n) {
      flex-break: after;
    }

    .actionWrapper {
      display: flex;
      align-items: center;
      justify-content: space-between;
      width: 100%;
    }

    .button {
      cursor: pointer;
      background: white;
      border-radius: 50px;
      border: 2px solid #2C67FF;
      padding: 20px;
      box-shadow: 0 1px 2px #ccc;
      color: #2C67FF;
      font-size: 16px;
      font-family: 'Google Sans';
    }

    .fillButton {
      cursor: pointer;
      color: white;
      background: #2C67FF;
      border-radius: 50px;
      border: 2px solid #2C67FF;
      padding: 20px;
      box-shadow: 0 1px 2px #ccc;
      font-size: 16px;
      font-family: 'Google Sans';
    }
`

css`
    .campaignList {
      display: flex;
      align-items: center;
      justify-content: center;
      flex-wrap: wrap;
    }
`

css`
      mwc-top-app-bar {
        --mdc-theme-primary: white;
        --mdc-theme-on-primary: black;
        box-shadow: 0 0 5px #ccc;
      }

      .banner {
        background-color: #306DFD;
        padding: 25px;
        color: white;
        font-size: 16px;
        line-height: 24px;
        display: flex;
        align-items: center;
        justify-content: center;
        text-align: center;
        box-shadow: 0 0 8px #ccc;
        margin-bottom: 10px;
      }

      .title {
        margin: 0 auto;
      }

      .subTitle {
        font-size: 12px;
        margin: 0 auto;
      }

      .titleContainer {
        padding:10px;
      }
    `
